import React, { useRef, useState } from 'react';

function ImageDetection() {
    const [previewImage, setPreviewImage] = useState('');
    const [fileName, setFileName] = useState('');
    const [resultText, setResultText] = useState('Results will appear here');
    const dropZoneRef = useRef(null);
    const fileInputRef = useRef(null);

    const preventDefaults = (e) => {
        e.preventDefault();
        e.stopPropagation();
    };

    const highlight = () => {
        if (dropZoneRef.current) {
            dropZoneRef.current.classList.add('drag-over');
        }
    };

    const unhighlight = () => {
        if (dropZoneRef.current) {
            dropZoneRef.current.classList.remove('drag-over');
        }
    };

    const handleFileUpload = (file) => {
        if (file && file.type.startsWith('image/')) {
            const reader = new FileReader();
            reader.onload = (e) => {
                setPreviewImage(e.target.result);
                setFileName(file.name);
            };
            reader.readAsDataURL(file);
        } else {
            alert('Please upload a valid image file');
        }
    };

    const handleDrop = (e) => {
        preventDefaults(e);
        unhighlight();
        const dt = e.dataTransfer;
        const files = dt.files;
        handleFileUpload(files[0]);
    };

    const handleFileInputChange = (e) => {
        handleFileUpload(e.target.files[0]);
    };

    const handleDetect = async () => {
        if (previewImage) {
            const res = await fetch(previewImage);
            const blob = await res.blob();

            const formData = new FormData();
            formData.append('file', blob, fileName);

            const response  = await fetch('http://127.0.0.1:3001/detect', {
                method: 'POST',
                body: formData,
            });
            const data = await response.json();
            console.log(data);
            const firstUrl = data.image[0];
            document.getElementById('resultText').style.display = 'none';
            document.getElementById('resultImage').setAttribute('src', firstUrl);  
        } else {
            setResultText('Please upload an image first');
        }
    };

    // Add event listeners using useEffect if needed
    React.useEffect(() => {
        const dropZone = dropZoneRef.current;
        const fileInput = fileInputRef.current;

        if (dropZone) {
            ['dragenter', 'dragover', 'dragleave', 'drop'].forEach(eventName => {
                dropZone.addEventListener(eventName, preventDefaults);
                document.body.addEventListener(eventName, preventDefaults);
            });

            ['dragenter', 'dragover'].forEach(eventName => {
                dropZone.addEventListener(eventName, highlight);
            });

            ['dragleave', 'drop'].forEach(eventName => {
                dropZone.addEventListener(eventName, unhighlight);
            });

            dropZone.addEventListener('drop', handleDrop);
        }

        // Cleanup event listeners
        return () => {
            if (dropZone) {
                ['dragenter', 'dragover', 'dragleave', 'drop'].forEach(eventName => {
                    dropZone.removeEventListener(eventName, preventDefaults);
                    document.body.removeEventListener(eventName, preventDefaults);
                });

                // Remove other event listeners similarly
            }
        };
    }, []);

    return (
        <div id="main-container">
            <div className="container">
                <div 
                    id="dropZone" 
                    ref={dropZoneRef} 
                    className="flex-box"
                >
                    <div className="upload-container">
                        <svg 
                            xmlns="http://www.w3.org/2000/svg" 
                            fill="none" 
                            viewBox="0 0 24 24" 
                            stroke="currentColor" 
                            className="upload-icon"
                        >
                            <path 
                                strokeLinecap="round" 
                                strokeLinejoin="round" 
                                strokeWidth="2" 
                                d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" 
                            />
                        </svg>

                        <p className="drag-text">Drag and Drop an image or</p>
                        <input 
                            type="file" 
                            id="fileInput" 
                            ref={fileInputRef}
                            accept="image/*" 
                            onChange={handleFileInputChange}
                        />
                        <label htmlFor="fileInput" className="upload-label">
                            Choose Image
                        </label>

                        <div style={{display: 'flex', flexDirection: 'row' , justifyContent: 'center' , alignItems:'center'}}>
                            {previewImage && (
                                <img 
                                    id="previewImage" 
                                    className="preview-image" 
                                    src={previewImage} 
                                    alt="ImagePreview" 
                                />
                            )}
                            {fileName && (
                                <div 
                                    id="fileName" 
                                    style={{marginLeft: '10px'}}
                                >
                                    {fileName}
                                </div>
                            )}
                        </div>
                    </div>
                </div>

                <button 
                    className="detect-button" 
                    onClick={handleDetect}
                >
                    Detect
                </button>

                <div className="flex-box">
                    <div className="result-container">
                        <p id="resultText">{resultText}</p>
                        <img src={''} alt="ResultImage" id='resultImage' />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ImageDetection;
